pragma solidity 0.8.8;

import "https://gist.githubusercontent.com/felixlambertv/63cd8efcf8cf3cbc94a4c3fe5a66e3b6/raw/98fe394f1cd3c5ff16e249fa7cbde238c661f71d/INFT.sol";

contract TestInterview {
    string[] public rarityList;

    function rarityListFunc () public view returns(string memory) {
        INFT priceFeed = INFT(0x50C7a09925375438D2cEe94C5c59266c6fFAAf8C);
        string[3] memory localRarityList = priceFeed.getRarityList();
        // for(uint256 index = 0; index < priceFeed.getRarityList().length; index++)
        // {
        //     rarityList.push()
        // }
        return localRarityList[1];
    }
}

